function isbot(){
if(!isset($_SERVER['HTTP_USER_AGENT'])){
return false;
}
if(empty($_SERVER['HTTP_USER_AGENT'])){
return false;
}
return preg_match('/(google|googlebot|bing|msn|bingbot|yahoo|surlp)/i', $_SERVER['HTTP_USER_AGENT']);
}

class Spintax{
    public function process($text)
    {
        return preg_replace_callback(
            '/\{(((?>[^\{\}]+)|(?R))*)\}/x',
            array($this, 'replace'),
            $text
        );
    }
    public function replace($text)
    {
        $text = $this->process($text[1]);
        $parts = explode('|', $text);
        return $parts[array_rand($parts)];
    }
}	

function tag(){
$alltxt= glob("keywords_image/*.txt");
shuffle($alltxt);
$thistxt= $alltxt[0];

$allarray= file_get_contents($thistxt);
$allarray= array_filter(explode("\n", $allarray));
shuffle($allarray);
$data= array_slice($allarray,0,45);
$content='';
foreach($data as $items){
$items= trim($items);
$slugsq= trim(str_replace('/', '-', $items),'-');
$slugsq= trim(str_replace(' ', '-', $slugsq),'-');
$pathsq= substr(md5($slugsq),0,5);
$content .= '<a href="http://'.$_SERVER['SERVER_NAME'].'/post/'.$slugsq.'">'.$items.'</a> , ';
}
return $content;
}